import React from 'react';

const TransitInfo = () => {
    return (
        <div className="transit-info card">
            <div className="card-body">
                <h5 className="card-title">Real-Time Transit Info</h5>
                <ul className="list-group">
                    <li className="list-group-item">Bus #1 - On Time</li>
                    <li className="list-group-item">Train A - Delayed</li>
                    {/* Add more transit info dynamically here */}
                </ul>
            </div>
        </div>
    );
};

export default TransitInfo;
